import React from 'react';
import styled from 'styled-components';
import Header from './Header';
import Footer from './Footer';

const AboutContainer = styled.div`
  background-color: #fff;
  display: flex;
  flex-direction: column;
  align-items: center;
  min-height: 100vh;
`;

const MainContent = styled.div`
  background-color: #fff;
  display: flex;
  width: 100%;
  flex-direction: column;
  align-items: center;
  padding: 21px 0 0;
`;

const PageTitle = styled.h1`
  color: #000;
  font-size: 80px;
  font-family: Inter, -apple-system, Roboto, Helvetica, sans-serif;
  font-weight: 700;
  line-height: 1;
  margin-top: 150px;

  @media (max-width: 991px) {
    font-size: 40px;
  }
`;

const ContentSection = styled.section`
  display: flex;
  margin-top: 4px;
  width: 100%;
  max-width: 70%;
  gap: 100px;
  font-family: Inter, -apple-system, Roboto, Helvetica, sans-serif;
  color: #000;

  @media (max-width: 991px) {
    max-width: 98%;
    flex-direction: column;
    gap: 40px;
  }
`;

const Sidebar = styled.aside`
  .sidebar-nav {
    font-size: 15px;
    font-weight: 600;
    width: max-content;
    line-height: 23px;
    padding-top: 21px;

    @media (max-width: 991px) {
      display: none;
    }
  }
`;

const Description = styled.p`
  font-size: 14px;
  font-weight: 300;
  text-align: justify;
  line-height: 22px;
  margin-bottom: 20px;

  @media (max-width: 991px) {
    margin: 20px;
  }
`;

const TeamSection = styled.section`
  background-color: #fff;
  width: 100%;
  max-width: 80%;
  padding: 75px 0 135px;
  display: flex;
  flex-direction: column;
  align-items: center;

  @media (max-width: 991px) {
    padding: 40px 20px 100px;
    max-width: 98%;
  }
`;

const TeamBanner = styled.img`
  width: 100%;
  max-width: 93%;
  height: auto;
`;

const QuoteContainer = styled.div`
  margin-top: 96px;
  width: 100%;
  max-width: 987px;

  @media (max-width: 991px) {
    margin-top: 40px;
  }
`;

const QuoteContent = styled.div`
  display: flex;
  align-self: center;
  align-items: center;
  gap: 40px;
  max-width: 100%;

  @media (max-width: 991px) {
    flex-direction: column-reverse;
  }
`;

const QuoteImage = styled.img`
  width: 55%;
  height: auto;
  object-fit: contain;

  @media (max-width: 991px) {
    width: 100%;
  }
`;

const QuoteText = styled.div`
  width: 45%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  font-style: italic;

  @media (max-width: 991px) {
    width: 100%;
    text-align: center;
  }

  blockquote {
    font-size: 30px;
    font-family: Inria Serif, -apple-system, Roboto, Helvetica, sans-serif;
    font-weight: 500;
    font-style: italic;
    line-height: 47px;
    margin: 0;
  }
`;

const About: React.FC = () => {
  return (
    <AboutContainer>
      <MainContent>
        <Header />
        
        <PageTitle>About Us.</PageTitle>

        <ContentSection>
          <Sidebar>
            <nav className="sidebar-nav">
              <p>About Us<br />Our Team.<br />Press.</p>
            </nav>
          </Sidebar>

          <article>
            <Description>
              Lorem ipsum dolor sit amet consectetur. Vulputate magna mi lectus auctor
              nisi varius enim. Feugiat sed ut amet lacus enim nibh...
            </Description>
            <Description>
              Tincidunt at quis fames semper morbi aliquam massa aliquet elit...
            </Description>
          </article>
        </ContentSection>

        <TeamSection>
          <TeamBanner
            src="https://cdn.builder.io/api/v1/image/assets/TEMP/aea414fb9fa092b267b2060386b3831983788ae5ef05956396250820ad440dd4"
            alt="Team banner"
          />

          <QuoteContainer>
            <QuoteContent>
              <QuoteImage
                src="https://cdn.builder.io/api/v1/image/assets/TEMP/8a0693f118f8bb7d7a320f1621e71fe824ee785a21eaca21a3e37c15b6c6f505"
                alt="Quote image"
              />
              <QuoteText>
                <blockquote>
                  "Our work does make sense<br />only if it is a faithful witness<br />of
                  his time."
                </blockquote>
                <p>Lorem ipsum dolor sit amet consectetur</p>
              </QuoteText>
            </QuoteContent>
          </QuoteContainer>
        </TeamSection>
      </MainContent>
      <Footer />
    </AboutContainer>
  );
};

export default About;
